import React from 'react';

const HistoryTable = () => {
  // Dummy data for the history table
  const historyData = [
    { providerName: "TREMENDOUS", offer: "$500", purchasedOn: "13/02/24" },
    // ... add more data as needed
  ];

  return (
    <div className="bg-blue-900 h-screen p-4 text-white">
      <h2 className="text-2xl font-bold mb-4">History</h2>
      <div className="overflow-x-auto">
        <table className="w-full">
          <thead>
            <tr className="text-left">
              <th className="pb-4">ProviderName</th>
              <th className="pb-4">OFFER</th>
              <th className="pb-4">PURCHASED ON</th>
            </tr>
          </thead>
          <tbody>
            {historyData.map((item, index) => (
              <tr key={index}>
                <td className="py-2">{item.providerName}</td>
                <td className="py-2">{item.offer}</td>
                <td className="py-2">{item.purchasedOn}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default HistoryTable;
